(235, 24, 20, 'sql7', 'PGM', 3, NULL, 'C', 'RTN_INT', 10, 'insert into CG_PGMINFO(\n	 PJTSEQ, PGMID, PGMNM, PKGGRP, PGMTYPE\n	, POPWIDTH, POPHEIGHT, SECTYPE\n	, ADDDT, ADDID\n) values (\n	 #{PJTSEQ},#{PGMID},#{PGMNM}, #{PKGGRP}, #{PGMTYPE}\n	, #{POPWIDTH}, #{POPHEIGHT}, #{SECTYPE}\n	 ,date_format(sysdate(),\'%Y%m%d%H%i%s\'),#{USER.SEQ}\n) \n', NULL, '20180727110800', NULL),
