(640, 3, 153, 'selGrpG', '그룹목록', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select GRP_SEQ, GRP_NM, USE_YN, ADD_DT, MOD_DT\nfrom CMN_GRP\nwhere 1 = 1\n	and case when length(#{G1-GRP_NM}) > 0 then \n		GRP_NM like concat(\'%\',#{G1-GRP_NM},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-USE_YN}) > 0 then \n		USE_YN like concat(\'%\',#{G1-USE_YN},\'%\')\n	else 1 = 1 end \n	and case when length(#{G1-GRP_SEQ}) > 0 then \n		GRP_SEQ = #{G1-GRP_SEQ}\n	else 1 = 1 end \n', 0, '20210209053304', '20210506194531'),
(641, 3, 153, 'selHoldG', '권한보유사용자', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.GRP_SEQ, a.USR_SEQ, b.USR_ID, b.USR_NM, a.ADD_DT, a.ADD_ID, a.ADD_ID as ADD_ID2\nfrom CMN_GRP_USR a\n	join CMN_USR b on a.USR_SEQ = b.USR_SEQ\nwhere GRP_SEQ = #{G2-GRP_SEQ}\n	and case when length(#{G1-USR_ID}) > 0 then \n		USR_ID = #{G1-USR_ID}\n	else 1 = 1 end \n	and case when length(#{G1-USR_NM}) > 0 then \n		USR_NM = #{G1-USR_NM}\n	else 1 = 1 end \n', 0, '20210209053304', '20210506194531'),
(642, 3, 153, 'selNoG', '권한미보유', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select \n	0 as CHK, USR_SEQ, USR_ID, USR_NM\nfrom \n	CMN_USR\nwhere USR_SEQ not in (\n	select USR_SEQ\n	from CMN_GRP_USR\n	where GRP_SEQ = #{G2-GRP_SEQ}\n)\n	and case when length(#{G1-USR_ID}) > 0 then \n		USR_ID = #{G1-USR_ID}\n	else 1 = 1 end \n	and case when length(#{G1-USR_NM}) > 0 then \n		USR_NM = #{G1-USR_NM}\n	else 1 = 1 end \n', 0, '20210209053304', '20210506194531'),
