(679, 3, 104, 'delAuth', 'SVCAUTH', 12, NULL, 'D', 'RTN_INT', 1, 'delete from CMN_AUTH\nwhere AUTH_SEQ = #{AUTH_SEQ}\n', 0, '20210216075205', '20210216075243'),
