(681, 3, 160, 'delMnu', 'SVCMNU', 12, NULL, 'D', 'RTN_INT', 10, 'delete from CMN_MNU\nwhere MNU_SEQ = #{MNU_SEQ}\n', 0, '20210216075907', NULL),
(682, 3, 160, 'insSvcAuth', 'SVCAUTH', 12, NULL, 'U', 'RTN_INT', 1, 'insert into CMN_AUTH (\n	PGMID, AUTH_ID, AUTH_NM, USE_YN\n	,ADD_DT\n)\nselect \n	#{PGMID} as PGMID, #{AUTH_ID} as AUTH_ID, #{AUTH_NM} as AUTH_NM, \'Y\' as USE_YN\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT\nfrom dual\nwhere \n 0 =  ( select count(AUTH_SEQ)  from CMN_AUTH where PGMID = #{PGMID} and AUTH_ID = #{AUTH_ID})\nlimit 1', 0, '20210216075907', '20210216085245'),
(683, 3, 160, 'insSvcPgmG', 'SVCMNU', 12, NULL, 'U', 'RTN_INT', 0, 'insert into CMN_MNU (\n	MNU_NM, PGMID, URL, PGMTYPE, MNU_ORD\n	, USE_YN, ADD_DT, ADD_ID\n)\nselect \n	#{PGMNM} as MNU_NM, #{PGMID} as PGMID, #{VIEWURL} as URL, #{PGMTYPE} as PGMTYPE, 10 as MNU_ORD\n	, \'Y\' as USE_YN, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT, 0 as ADD_ID\nfrom dual\nwhere \n 0 =  ( select count(MNU_SEQ)  from CMN_MNU where PGMID = #{PGMID} )\nlimit 1', 0, '20210216075907', '20210216084035');
INSERT INTO `CG_PGMSQL` (`SQLSEQ`, `PJTSEQ`, `PGMSEQ`, `SQLID`, `SQLNM`, `SVRSEQ`, `SVRIDPARAM`, `CRUD`, `RTN_TYPE`, `SQLORD`, `SQLTXT`, `PSQLSEQ`, `ADDDT`, `MODDT`) VALUES
(684, 3, 160, 'sAuthG', 'AUTH', NULL, 'G1-FROMSVRID', 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n 	0 as CHK\n	, concat(p.PGMID,\'-\',g.GRPID,\'_\',f.FNCID) as ROWID\n	, p.PGMID \n	, concat(g.GRPID,\'_\',f.FNCID) as AUTH_ID\n	, concat(g.GRPNM,\'_\',f.FNCNM) as AUTH_NM \n	, f.ADDDT\nFROM \n      CG_PGMGRP g\n      JOIN CG_PGMFNC f on g.GRPSEQ = f.GRPSEQ and g.PGMSEQ = f.PGMSEQ\n      JOIN CG_PGMINFO p on p.PGMSEQ = g.PGMSEQ\nWHERE p.PJTSEQ = #{G1-PJTSEQ} AND ( f.FNCTYPE != \'\' && f.FNCTYPE is not null )\n	and case when length(#{G1-PGMID}) > 0 then \n			p.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n		else 1=1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then \n			concat(g.GRPID,\'_\',f.FNCID)  = #{G1-AUTH_ID}\n		else 1=1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then \n		concat(g.GRPNM,\'_\',f.FNCNM) like concat(\'%\', #{G1-AUTH_NM}, \'%\')\n	else 1=1 end\norder by p.PGMID,g.GRPORD asc,f.FNCORD asc  \n', 0, '20210216075907', '20210323081118'),
(685, 3, 160, 'sPgmG', 'PGM', NULL, 'G1-FROMSVRID', 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	0 as CHK, PGMSEQ, PGMID, PGMNM, PKGGRP, VIEWURL, PGMTYPE, SECTYPE, ADDDT, MODDT\nFROM \n	CG_PGMINFO\nWHERE PJTSEQ = #{G1-PJTSEQ}\n	and case when length(#{G1-PGMID}) > 0 then \n		PGMID like concat(\'%\', #{G1-PGMID}, \'%\')\n	else 1 = 1 end\n	and case when length(#{G1-PGMNM}) > 0 then \n		PGMNM like concat(\'%\',#{G1-PGMNM},\'%\')\n	else 1 = 1 end\n', 0, '20210216075907', '20210323081118'),
(686, 3, 160, 'sSvcAuthG', 'SVCAUTH', 12, NULL, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	\'0\' as CHK, AUTH_SEQ, PGMID, AUTH_ID, AUTH_NM, USE_YN\n	, ADD_DT, MOD_DT \nFROM CMN_AUTH\nWHERE 1 = 1\n	and case when length(#{G1-PGMID}) > 0 then \n		PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n		else 1=1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then \n		AUTH_ID  like concat(\'%\', #{G1-AUTH_ID}, \'%\')\n		else 1=1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then \n		AUTH_NM like concat(\'%\', #{G1-AUTH_NM}, \'%\')\n		else 1=1 end', 0, '20210216075907', '20210216085018'),
(687, 3, 160, 'sSvcMenuG', 'SVCMNU', 12, NULL, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	\'0\' as CHK, MNU_SEQ, MNU_NM, PGMID, URL, PGMTYPE\n	, MNU_ORD, USE_YN, ADD_DT, ADD_ID\n	,MOD_DT, MOD_ID  \nFROM CMN_MNU\nWHERE 1 = 1\n	and case when length(#{G1-PGMID}) > 0 then \n		PGMID like concat(\'%\', #{G1-PGMID}, \'%\')\n	else 1 = 1 end\n	and case when length(#{G1-PGMNM}) > 0 then \n		MNU_NM like concat(\'%\',#{G1-PGMNM},\'%\')\n	else 1 = 1 end\n', 0, '20210216075907', '20210216085041'),
(688, 3, 161, 'sLockG', 'lock', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'SELECT\n	LOGIN_SEQ, USR_ID, SESSION_ID, SUCCESS_YN, LOCKCD, PW_ERR_CNT, LOCK_LIMIT_DT\n	, USR_SEQ, ADD_DT\nFROM CMN_LOG_LOGIN\nWHERE LOCKCD IN (\'GOLOCK\',\'UNLOCK\')\n	AND USR_ID = #{USER.ID}\nORDER BY LOGIN_SEQ DESC', 0, '20210218074119', '20210506194251'),
(689, 3, 161, 'sLoginG', 'login', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'SELECT\n	LOGIN_SEQ, USR_ID, SESSION_ID, SUCCESS_YN, RESPONSE_MSG\n	, PW_ERR_CNT, LOCKCD, USR_SEQ, SERVER_NAME, REMOTE_ADDR\n	, USER_AGENT, ADD_DT\nFROM CMN_LOG_LOGIN\nWHERE USR_ID = #{USER.ID}\nORDER BY LOGIN_SEQ DESC', 0, '20210218074119', '20210506194251'),
(690, 3, 161, 'sMenuG', 'menu', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'SELECT\n	LAUTH_SEQ, REQ_TOKEN, RES_TOKEN, USR_SEQ, USR_ID\n	, PGMID, AUTH_ID, SUCCESS_YN, ADD_DT\nFROM CMN_LOG_AUTH\nWHERE USR_ID = #{USER.ID}\nORDER BY LAUTH_SEQ DESC', 0, '20210218074119', '20210506194251'),
