(696, 3, 163, 'insNoToHoldG', '권한 추가', 15, '', 'U', 'RTN_INT', 0, 'insert into CMN_TEAM_AUTH (\n	TEAM_SEQ, PGMID, AUTH_ID, ADD_DT, ADD_ID\n) \nselect\n	#{G2-TEAM_SEQ} as  TEAM_SEQ, PGMID, AUTH_ID, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT, 0 as ADD_ID\nfrom CMN_AUTH\nWHERE AUTH_SEQ = #{AUTH_SEQ}', 0, '20210224073027', '20210506194128'),
(697, 3, 163, 'selGrpG', '그룹목록', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select \n	TEAM_SEQ, TEAMCD, TEAMNM, USE_YN\n	, ADD_DT, ADD_ID\nfrom CMN_TEAM\nwhere 1 = 1\n	and case when length(#{G1-TEAMNM}) > 0 then\n		TEAMNM like concat(\'%\',#{G1-TEAMNM},\'%\')\n	else 1 = 1 end\n', 0, '20210224073027', '20210506194128'),
(698, 3, 163, 'selHoldG', '보유 권한', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.TA_SEQ, a.TEAM_SEQ, a.PGMID, b.MNU_NM, a.AUTH_ID, c.AUTH_NM, a.ADD_DT, a.ADD_ID\nfrom CMN_TEAM_AUTH a\n	left outer join CMN_MNU b on a.PGMID = b.PGMID\n	left outer join CMN_AUTH c on a.PGMID = c.PGMID and a.AUTH_ID = c.AUTH_ID\nwhere a.TEAM_SEQ = #{G2-TEAM_SEQ}\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		c.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210224073027', '20210506194128'),
(699, 3, 163, 'selNoG', '미보유 권한', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.AUTH_SEQ, a.PGMID, c.MNU_NM, a.AUTH_ID, a.AUTH_NM, a.USE_YN, a.ADD_DT, a.MOD_DT\nfrom CMN_AUTH a\n	left outer join CMN_MNU c on a.PGMID = c.PGMID\nwhere not exists(\n	select\n		*\n	from CMN_TEAM_AUTH b\n	where b.TEAM_SEQ = #{G2-TEAM_SEQ} and a.PGMID = b.PGMID and a.AUTH_ID = b.AUTH_ID\n)\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		a.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210224073027', '20210506194128'),
(700, 3, 162, 'selNo', 'TEAM', 15, '', 'R', 'RTN_SELECT_LIST', 10, 'select\n	\'0\' as CHK, TEAMCD, TEAMNM\nfrom CMN_USR\nwhere \nTEAMCD is not null and TEAMCD <> \'\'\nand TEAMCD not in \n	(\n	select TEAMCD from CMN_TEAM\n	)\ngroup by TEAMCD,TEAMNM', 0, '20210224075642', '20210506194219'),
(701, 3, 162, 'chkSave', 'TEAM', 15, '', 'U', 'RTN_INT', 1, 'insert into CMN_TEAM\n(\n	TEAMCD, TEAMNM, USE_YN, INTRO_PGMID\n	, ADD_DT, ADD_ID\n)\nselect\n	#{TEAMCD}, #{TEAMNM}, \'Y\', #{INTRO_PGMID}\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\'), 0\nfrom dual\nwhere 0 = ( select count(*) as CNT from CMN_TEAM where TEAMCD = #{TEAMCD} )\n', 0, '20210224080018', '20210506194219'),
(702, 3, 152, 'selTeam', 'TEAM', 15, '', 'R', 'RTN_SELECT_LIST', 1, 'SELECT \n	a.USR_SEQ, b.TEAM_SEQ, b.TEAMCD, b.TEAMNM, b.USE_YN, a.ADD_DT\nFROM \n	CMN_USR a \n	join CMN_TEAM b \n		on a.TEAMCD = b.TEAMCD\nWHERE a.USR_SEQ = #{G2-USR_SEQ}', 0, '20210225073243', '20210506194616'),
(703, 3, 164, 'delHoldG', '권한 삭제', 15, '', 'D', 'RTN_INT', 0, 'delete from CMN_DEFAULT_AUTH where DA_SEQ = #{DA_SEQ}', 0, '20210225080221', '20210506194025'),
(704, 3, 164, 'insNoToHoldG', '권한 추가', 15, '', 'U', 'RTN_INT', 0, 'insert into CMN_DEFAULT_AUTH (\n	PGMID, AUTH_ID, ADD_DT, ADD_ID\n) \nselect\n	PGMID, AUTH_ID, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT, 0 as ADD_ID\nfrom CMN_AUTH\nWHERE AUTH_SEQ = #{AUTH_SEQ}\n', 0, '20210225080221', '20210506194025'),
(706, 3, 164, 'selHoldG', '보유 권한', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.DA_SEQ, a.PGMID, b.MNU_NM, a.AUTH_ID, c.AUTH_NM, a.ADD_DT, a.ADD_ID\nfrom CMN_DEFAULT_AUTH a\n	left outer join CMN_MNU b on a.PGMID = b.PGMID\n	left outer join CMN_AUTH c on a.PGMID = c.PGMID and a.AUTH_ID = c.AUTH_ID\nwhere 1=1 \n	and case when length(#{G1-PGMID}) > 0 then\n		 a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-MNU_NM}) > 0 then\n		 b.MNU_NM like concat(\'%\',#{G1-MNU_NM},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		c.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n		else 1 = 1 end\n', 0, '20210225080221', '20210614202814'),
(707, 3, 164, 'selNoG', '미보유 권한', 15, '', 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.AUTH_SEQ, a.PGMID, c.MNU_NM, a.AUTH_ID, a.AUTH_NM, a.USE_YN, a.ADD_DT, a.MOD_DT\nfrom CMN_AUTH a\n	left outer join CMN_MNU c on a.PGMID = c.PGMID\nwhere not exists(\n	select\n		*\n	from CMN_DEFAULT_AUTH b\n	where a.PGMID = b.PGMID and a.AUTH_ID = b.AUTH_ID\n)\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-MNU_NM}) > 0 then\n		c.MNU_NM like concat(\'%\',#{G1-MNU_NM},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		a.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210225080221', '20210614202731'),
