(709, 3, 152, 'unLockUsr', 'USR', 15, '', 'U', 'RTN_INT', 10, 'update CMN_USR set\n	PW_ERR_CNT = 0, LOCK_LIMIT_DT = null, LOCK_LAST_DT = null\n	, MOD_DT = date_format(sysdate(),\'%Y%m%d%H%i%s\'), MOD_ID = #{USER.SEQ}\nwhere USR_SEQ = #{USR_SEQ}', 0, '20210311082934', '20210506194616'),
(710, 3, 166, 'selG', 'FLUENTD', 14, '', 'R', 'RTN_SELECT_LIST', 10, 'select \n	SEQ, SRC, CONTAINERNM, CONTAINERID, LOG\n	, ifnull(MSG,\'\') as MSG\n	, DATE_FORMAT(ADDDT,\'%Y.%m.%d %H:%i:%S\') as ADDDT\nfrom\n	FLUENTLOG\nwhere\n	ADDDT >= concat(replace(#{G1-FROM_ADDDT},\'-\',\'\'),\'000000\')\n	and ADDDT <= concat(replace(#{G1-TO_ADDDT},\'-\',\'\'),\'235959\')\n	and case when length(#{G1-SRC}) > 0 then \n		SRC like concat(\'%\',#{G1-SRC},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-CONTAINERNM}) > 0 then \n		CONTAINERNM like concat(\'%\',#{G1-CONTAINERNM},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-CONTAINERID}) > 0 then \n		CONTAINERID like concat(\'%\',#{G1-CONTAINERID},\'%\')\n		else 1 = 1 end\n	and case when length(#{G1-LOG}) > 0 then \n		LOG like concat(\'%\',#{G1-LOG},\'%\')\n		else 1 = 1 end\norder by SEQ desc\nlimit #{G1-ROWLIMIT}', 0, '20210312075103', '20210616222220'),
(711, 3, 166, 'selF', 'FLUENTD', 14, '', 'R', 'RTN_SELECT_ONE', 10, 'select \n	SEQ, SRC, CONTAINERNM, CONTAINERID, LOG, ifnull(MSG,\'\') as MSG\n	, ADDDT\nfrom\n	FLUENTLOG\nwhere\n	SEQ = #{G2-SEQ}\n', 0, '20210312081421', '20210717215139'),
(712, 3, 167, 'selF', 'CFG', 15, '', 'R', 'RTN_SELECT_ONE', 2, 'select \n	CFG_SEQ, ACT_PGMID, OLD_CFG, NEW_CFG, HOST_NM\n	, RESULT_YN, RESULT_MSG, ADD_DT\nfrom CMN_CFG_HISTORY\nwhere CFG_SEQ = #{G2-CFG_SEQ}\n', 0, '20210318075603', '20210506193736'),
(713, 3, 167, 'selG', 'CFG', 15, '', 'R', 'RTN_SELECT_LIST', 1, 'select \n	CFG_SEQ, ACT_PGMID, OLD_CFG, NEW_CFG, HOST_NM\n	, RESULT_YN, RESULT_MSG, ADD_DT\nfrom CMN_CFG_HISTORY\nwhere 1 = 1\n	and case when length(#{G1-CFG_SEQ}) > 0 then\n		CFG_SEQ = #{G1-CFG_SEQ}\n	else 1 = 1 end\n	and case when length(#{G1-ACT_PGMID}) > 0  then\n		ACT_PGMID = #{G1-ACT_PGMID}\n	else 1 = 1 end\n	and case when length(#{G1-HOST_NM}) > 0  then\n		HOST_NM = #{G1-HOST_NM}\n	else 1 = 1 end\n	and case when length(#{G1-RESULT_YN}) > 0  then\n		RESULT_YN = #{G1-RESULT_YN}\n	else 1 = 1 end\n	and case when length(#{G1-RESULT_MSG}) > 0  then\n		RESULT_MSG = #{G1-RESULT_MSG}\n	else 1 = 1 end\n	and case when length(#{G1-ADD_DT}) > 0  then\n		ADD_DT between concat(replace(#{G1-ADD_DT},\'-\',\'\'),\'000000\') \n			and concat(replace(#{G1-ADD_DT},\'-\',\'\'),\'235959\') \n	else 1 = 1 end\norder by CFG_SEQ desc\n', 0, '20210318075603', '20210506193736'),
